import React from "react";

class Weather extends React.Component {
  render() {
    return( 
      <div>
        {this.state.temp}
        {this.state.city}
        {this.state.country}
        {this.state.sunrise}
        {this.state.sunset}
        {this.state.error}
      </div>
    );
  }
}

export default Weather;
